(46, '{\"en\":\"Hostel Casa Preturii\",\"ro\":\"Hostel Casa Preturii\"}', '{\"en\":\"<p>Hotelul Casa Preturii *** din orasul Targu Lapus, judetul Maramures, este situat intr-o frumoasa depresiune intramontana aflata la poalele Muntilor Tibles si Satra, cunoscuta sub numele de &rdquo;Tara Lapusului&rdquo;. Zona etnografic distincta, unde relieful pitoresc, traditiile si obiceiurile au ramas inca nealterate, acestea reprezentand o mica parte din atractiile turistice.<\\/p>\",\"ro\":\"<p>Hotelul Casa Preturii *** din orasul Targu Lapus, judetul Maramures, este situat intr-o frumoasa depresiune intramontana aflata la poalele Muntilor Tibles si Satra, cunoscuta sub numele de &rdquo;Tara Lapusului&rdquo;. Zona etnografic distincta, unde relieful pitoresc, traditiile si obiceiurile au ramas inca nealterate, acestea reprezentand o mica parte din atractiile turistice.<\\/p>\"}', '0720600822', 'tu@hailanoi.ro', 'www.hailanoi.ro', 'https://www.facebook.com/CasaPreturii/', 0, 'uploads/restaurant/361d2225803cd2813ec508a0e48f753c.jpg', '2020-12-14 18:18:34', '2021-02-04 14:02:10', 'Str. Piata Eroilor, nr. 21, 435600  Targu Lapus, Maramures, Romania', '[{\"category_id\":7074,\"name\":\"49\",\"name_table\":\"10\",\"number\":30},{\"category_id\":9288,\"name\":\"2\",\"name_table\":\"4\",\"number\":5},{\"category_id\":7107,\"name\":\"5\",\"name_table\":\"4\",\"number\":5},{\"category_id\":2041,\"name\":\"11\",\"name_table\":\"8\",\"number\":5}]', 0, 1, 1, 40, 'tu@hailanoi.ro', 'weekly', '2021-02-04 14:02:10', 'https://getpublii.com/themes/demo/cortado/menu/', NULL, 1, 0, 'C6ni6m47LnG4k142p3ONZ4zu94QpBfX1', NULL, NULL),
(53, '{\"ro\":\"Farmer\\u2019s House\",\"en\":\"Farmer\\u2019s House\"}', '{\"ro\":\"<p>\\u0218tim cu to\\u021bii c&acirc;t este de important s\\u0103 cunoa\\u0219tem sursa produselor pe care le consum\\u0103m - &icirc;ncep&acirc;nd de la fiecare ingredient &icirc;n parte, p&acirc;n\\u0103 la preparatul din farfurie.De aceea am decis s\\u0103 intr\\u0103m pu\\u021bin &icirc;n &rdquo;dedesubturile&rdquo; preparatelor noastre.Pentru un gust autentic \\u0219i o textur\\u0103 fraged\\u0103, folosim exclusiv carne ce provine de la animalele crescute &icirc;n ferma noastr\\u0103, hr\\u0103nite natural - f\\u0103r\\u0103 antibiotice, hormoni sau steroizi - ad\\u0103pate cu ap\\u0103 curat\\u0103 \\u0219i atent &icirc;ngrijite, conform standardelor de s\\u0103n\\u0103tate \\u0219i siguran\\u021b\\u0103.<\\/p>\\r\\n\\r\\n<p>Celelalte produse pe care le folosim &icirc;n prepararea re\\u021betelor noastre sunt proaspete \\u0219i s\\u0103n\\u0103toase, din gr\\u0103dinile \\u0219i livezile produc\\u0103torilor locali.Dorin\\u021ba noastr\\u0103 este ca tu s\\u0103 beneficiezi de arome, nutrien\\u021bi \\u0219i calitate atunci c&acirc;nd ne treci pragul!<\\/p>\",\"en\":\"<p>\\u0218tim cu to\\u021bii c&acirc;t este de important s\\u0103 cunoa\\u0219tem sursa produselor pe care le consum\\u0103m - &icirc;ncep&acirc;nd de la fiecare ingredient &icirc;n parte, p&acirc;n\\u0103 la preparatul din farfurie.De aceea am decis s\\u0103 intr\\u0103m pu\\u021bin &icirc;n &rdquo;dedesubturile&rdquo; preparatelor noastre.Pentru un gust autentic \\u0219i o textur\\u0103 fraged\\u0103, folosim exclusiv carne ce provine de la animalele crescute &icirc;n ferma noastr\\u0103, hr\\u0103nite natural - f\\u0103r\\u0103 antibiotice, hormoni sau steroizi - ad\\u0103pate cu ap\\u0103 curat\\u0103 \\u0219i atent &icirc;ngrijite, conform standardelor de s\\u0103n\\u0103tate \\u0219i siguran\\u021b\\u0103.<\\/p>\\r\\n\\r\\n<p>Celelalte produse pe care le folosim &icirc;n prepararea re\\u021betelor noastre sunt proaspete \\u0219i s\\u0103n\\u0103toase, din gr\\u0103dinile \\u0219i livezile produc\\u0103torilor locali.Dorin\\u021ba noastr\\u0103 este ca tu s\\u0103 beneficiezi de arome, nutrien\\u021bi \\u0219i calitate atunci c&acirc;nd ne treci pragul!<\\/p>\"}', '00 40 (744) 573 181', 'farmershousebeius@gmail.com', 'https://farmershouse.business.site/', 'https://facebook.com/restaurantfarmershouse/', 0, 'uploads/restaurant/612c449e1d819afa133873f382bf7976.jpg', '2021-02-16 11:11:54', '2021-03-20 00:10:58', 'Strada Horea nr. 63 Beiuș 415200 Romania', '[{\"category_id\":9863,\"name\":\"2\",\"name_table\":\"4\",\"number\":10},{\"category_id\":6083,\"name\":\"7\",\"name_table\":\"4\",\"number\":11},{\"category_id\":9699,\"name\":\"25\",\"name_table\":\"4\",\"number\":3},{\"category_id\":5142,\"name\":\"24\",\"name_table\":\"4\",\"number\":1},{\"category_id\":7882,\"name\":\"4\",\"name_table\":\"5\",\"number\":1}]', 0, 1, 1, 48, 'farmershousebeius@gmail.com', 'weekly', '2021-03-19 17:17:28', NULL, NULL, 0, 0, NULL, NULL, NULL),
