(1, 'contact_email', 'Contact form email address', 'The email address that all emails from the contact form will go to.', 'contact@picoly.app', '{\"name\":\"value\",\"label\":\"Value\",\"type\":\"email\"}', 1, NULL, '2020-03-04 19:06:25'),
(4, 'print_width', 'Qr page width size (in mm)', 'Qr page width size', '106', '{\"name\":\"value\",\"label\":\"Value\",\"type\":\"number\"}', 1, NULL, '2020-08-14 02:06:02'),
(5, 'print_height', 'Print QR page height size (in mm)', 'Print QR page height size (in mm)', '74', '{\"name\":\"value\",\"label\":\"Value\",\"type\":\"number\"}', 1, NULL, '2020-08-14 02:04:54'),
(6, 'about', 'Despre noi text', 'Text in aplicatie - Despre noi', '<p><strong>Te mulțumește Aplicația Picoly? </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dacă ți-a plăcut sistemul nostru prin care poți chema ospătarul și comanda mult mai rapid, dacă ai vrea să-l folosești și &icirc;n alte locații pe care le frecventezi, ai acordul nostru să ne recomanzi aplicația și totodată serviciile. Datele noastre de contact sunt:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.picoly.app\" target=\"_blank\">www.picoly.app</a></p>\r\n\r\n<p><a href=\"mailto:contact@picoly.app\">contact@picoly.app</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Despre Aplicația Picoly </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Icirc;n ultimul deceniu mai ales, telefoanele mobile, &icirc;ndeosebi modelele Smart, au schimbat radical modul &icirc;n care oamenii comunică și au acces la produsele și serviciile din jurul lor. Prin intermediul rețelei de Internet, totul este mai conectat, mai accelerat și totodată mai simplificat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Aplicația <strong>Picoly</strong> bazată tocmai pe acest principiu al comodității, facilitează modul &icirc;n care comanzi &icirc;ntr-un local, cafenea, restaurant etc. și-l adaptează la exigențele impuse de epoca vitezei.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sistemul nostru se pretează perfect la locații de genul Restaurante, Baruri, Cafenele, Cluburi, Terase, Piscine, Resorturi și orice furnizori de servicii din domeniul HoReCa, care-și servesc clienții prin intermediul personalului angajat (ospătari, barmani, recepționeri etc.).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><em>Această aplicație a fost g&acirc;ndită pentru a alinia și <strong>serviciile din domeniul HoReCa</strong> &icirc;n r&acirc;nd cu tehnologia și epoca vitezei.</em></li>\r\n	<li><em>Sistemul rezolvă problemele frecvente &icirc;nt&acirc;mpinate de clienți să cheme personalul de serviciu: ospătarul, recepționerul etc. pentru a le lua comanda.</em></li>\r\n	<li><em>Cu o simplă <strong>scanare a unui cod QR</strong> prezent pe masă, din c&acirc;teva mișcări, clientul poate solicita personalul și <strong>alte servicii</strong>: &icirc;ncă o tură, nota de plată etc.</em></li>\r\n</ul>\r\n\r\n<p>Aplicația <strong>Picoly</strong> este foarte <strong>simplu de instalat</strong> și reprezintă o necesitate pentru orice furnizor de servicii din industria HoReCa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ce avantaje asigură Aplicația Picoly? </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Funcția primară a aplicației Picoly (APEL OSPĂTAR) este foarte eficientă să elimine posibilele probleme de comunicare cu ospătarul sau un alt angajat, ajut&acirc;nd la:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Optimizarea vitezei de servire;</li>\r\n	<li>Reducerea timpilor de așteptare;</li>\r\n	<li>Servirea unor clienți &icirc;nc&acirc;ntați de locație;</li>\r\n	<li>Crearea unei atmosfere mai senine &icirc;n perimetru.</li>\r\n</ul>\r\n\r\n<p><strong>Ce face aplicația noastră? </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Clienții care ajung &icirc;ntr-o locație care are implementată aplicația Picoly, găsesc pe mese pliante / etichete cu codurile QR afișate.</p>\r\n\r\n<p>După simpla scanare a unui cod folosind telefonul mobil, vor putea comunica imediat cu personalul angajat din respectiva locație.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Icirc;n secțiunea APEL OSPĂTAR, clientul are la dispoziție următoarele opțiuni:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>CHEAMĂ OSPĂTARUL;</li>\r\n	<li>&Icirc;NCĂ O TURĂ;</li>\r\n	<li>ANULEAZĂ COMANDA;</li>\r\n	<li>NOTA DE PLATĂ.</li>\r\n</ul>\r\n\r\n<p>Acces&acirc;nd secțiunea OFERTE, poate vedea, direct din aplicație, CELE MAI BUNE OFERTE ALE LOCAȚIEI.</p>\r\n\r\n<p>Cu secțiunea FEEDBACK, poate evalua serviciile și produsele oferite, acord&acirc;nd calificative sau / și lăs&acirc;nd mesaj prin care să-și exprime părerile.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cum funcționează Aplicația Picoly? </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Icirc;n primul r&acirc;nd, &icirc;n calitate de client, vei descărca GRATUIT aplicația din <strong>App Store</strong> sau <strong>Google Play</strong>.</p>\r\n\r\n<p>Deschizi aplicația și scanezi codul QR prezent, după caz, pe masa din local, de pe terasă, de pe șezlong, din camera de hotel etc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O clipă mai t&acirc;rziu, ți se va deschide panoul de comandă. Simultan, prin interfața de administrare a locației, angajații sunt &icirc;nștiințați că cineva s-a conectat prin aplicație și se află la respectiva locație.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ajunge să accesezi butonul din corespondența acțiunii ce te interesează (APEL OSPĂTAR, OFERTE etc.) și să lansezi una dintre opțiuni.</p>', '{\"name\":\"value\",\"label\":\"Value\",\"type\":\"ckeditor\"}', 1, NULL, '2020-05-05 10:29:37'),
(7, 'terms', 'Politica de confidentialitate', 'Text in aplicatie - Politica de confidentialitate', '<p><strong>Politica de Confidențialitate</strong></p>\r\n\r\n<p>Prezenta Politică de Confidențialitate (&quot;Politica&quot;) are &icirc;n vedere aplicația Picoly (denumită &icirc;n continuare &quot;Aplicație&quot;).</p>\r\n\r\n<p>Declarăm că nu colectăm niciun fel de date, informaţii personale identificabile &icirc;n momentul vizitării Aplicației, cu excepţia situaţiilor &icirc;n care utilizatorul consimte să ni le furnizeze sau &icirc;n cazurile expres prevăzute de prezenta Politică.</p>\r\n\r\n<p>Actuala Politică prezintă principiile noastre generale &icirc;n ceea ce priveşte prelucrarea datelor personale aparţin&acirc;nd utilizatorilor Aplicației.</p>\r\n\r\n<p>Vrem să ne asigurăm că fiecare &icirc;nţelege modalităţile &icirc;n care vom folosi sau nu informaţiile pe care ni le &icirc;ncredinţează.</p>\r\n\r\n<p>Pentru a &icirc;nţelege propriile tale drepturi, te sfătuim să citești prezenta Politică.</p>\r\n\r\n<p><strong>I. Principii de protecţie a datelor</strong></p>\r\n\r\n<p>Ne angajăm să urmăm urmatoarele principii de protecţie și prelucrare a datelor cu caracter personal:</p>\r\n\r\n<p>Procesarea este legală, corectă, transparentă. Activitățile noastre de prelucrare au motive legale. &Icirc;ntotdeauna considerăm drepturile utilizatorului &icirc;nainte de prelucrarea datelor personale. &Icirc;ți vom furniza informații privind prelucrarea la cerere.</p>\r\n\r\n<p>Procesarea este limitată ca scop. Activitățile noastre de procesare corespund scopului pentru care au fost colectate datele personale.</p>\r\n\r\n<p>Procesarea se face cu date minime. Noi colectăm și procesăm doar cantitatea minimă de date personale necesare pentru orice scop.</p>\r\n\r\n<p>Prelucrarea este limitată pe o perioadă de timp de 5 ani. Nu vom stoca datele cu caracter personal pentru o perioadă mai mare dec&acirc;t este necesar.</p>\r\n\r\n<p>Vom face tot posibilul să asigurăm acurateţea, integritatea și confidențialitatea datelor.</p>\r\n\r\n<p><strong>II. Ce date personale colectăm</strong></p>\r\n\r\n<p><strong>1. Informații furnizate de utilizator</strong></p>\r\n\r\n<p>&Icirc;n general, aplicațiile pot colecta adresa ta de e-mail, numele, adresa de facturare, adresa de domiciliu sau alte informații necesare pentru livrarea unui produs sau serviciu.</p>\r\n\r\n<p>Aplicația Picoly nu livrează produse sau servicii care necesită colectarea acestor date, &icirc;n consecință, aceste date personale nu sunt colectate sau prelucrate de către aplicație.</p>\r\n\r\n<p><strong>2. Informaţii colectate automat despre utilizator</strong></p>\r\n\r\n<p>Aplicația Picoly prelucrează date despre comportamentul utilizatorului privind folosirea Aplicației. Include, dar fără să se limiteze la date de sesiune, comportament browsing, date despre locație, date demografice, adresa de Protocol Internet (adresa IP), acolo unde este disponibilă.</p>\r\n\r\n<p>Acestea sunt date statistice despre acțiunile și modelele de navigare ale vizitatorilor aplicației, care nu identifică niciun individ și sunt colectate &icirc;n scopul &icirc;mbunătățirii și personalizării Aplicației pe bază de cookies.</p>\r\n\r\n<p>Această prelucrare se bazează &icirc;n mod legitim pe Art. 6, alin 1, litera a), b), c), f), GDPR.</p>\r\n\r\n<p>Aceste informații sunt utilizate pentru a &icirc;mbunătăți experiența clienților.</p>\r\n\r\n<p>Astfel, c&acirc;nd o persoană ne utilizează serviciile sau caută conținutul Aplicației, activitățile sale pot fi &icirc;nregistrate.</p>\r\n\r\n<p><strong>3. Informații cu caracter public</strong></p>\r\n\r\n<p>Este posibil sa colectăm informații cu caracter public despre clienți.</p>\r\n\r\n<p><strong>III. Măsuri tehnice și de organizare și securitatea prelucrării</strong></p>\r\n\r\n<p>Toate informațiile pe care le primim despre un client sunt stocate pe servere securizate localizate &icirc;n Rom&acirc;nia. &Icirc;n mod specific și conform legii, luăm măsuri tehnice și organizatorice adecvate (politici și proceduri, securitate informatică etc.) pentru a asigura confidențialitatea și integritatea datelor cu caracter personal și a modului &icirc;n care sunt prelucrate.</p>\r\n\r\n<p>Garantăm că nu vindem datele cu caracter personal pe care le-am colectat de la vizitatori și că nu transmitem aceste date dec&acirc;t celor &icirc;n drept să le cunoască, cu respectarea principiilor și obligațiilor stabilite prin lege.</p>\r\n\r\n<p>Atragem atenția celor care utilizează Aplicația Picoly că aceasta poate conţine link-uri către website-uri a căror politică de confidenţialitate sau de prelucrare a datelor cu caracter personal este diferită de cea a Aplicației Picoly.</p>\r\n\r\n<p>Cine trimite date cu caracter personal către oricare dintre aceste site-uri, informațiile sale cad sub incidenţa declaraţiei de confidenţialitate sau de prelucrare a datelor cu caracter personal. Politica Aplicației Picoly privind prelucrarea și protecția datelor cu caracter personal nu se aplică informaţiilor furnizate pe acele website-uri. &Icirc;n acest sens, recomandăm vizitatorilor citirea cu atenţie a politicii de confidenţialitate a oricărui website pe care &icirc;l vizitează.</p>\r\n\r\n<p>Este bine de reținut că, &icirc;n ciuda măsurilor pe care le-am implementat pentru a proteja datele clienților, transferul de date prin Internet sau alte rețele deschise nu este niciodată complet sigur. Și există riscul ca datele personale să fie accesate de terți neautorizați.</p>\r\n\r\n<p><strong>IV. Drepturile Utilizatorului</strong></p>\r\n\r\n<p>&Icirc;n calitate de persoană vizată, Utilizatorul ne poate contacta &icirc;n orice moment și &icirc;n mod gratuit, cu o notificare, folosind adresa de e-mail contact@picoly.app, &icirc;n vederea exercitării drepturilor sale, &icirc;n conformitate cu GDPR.</p>\r\n\r\n<p>Aceste drepturi sunt următoarele:</p>\r\n\r\n<p><strong>a.</strong> Dreptul de a primi informații cu privire la prelucrarea datelor și o copie a datelor procesate.</p>\r\n\r\n<p><strong>b.</strong> Dreptul de a solicita rectificarea datelor inexacte sau completarea datelor incomplete.</p>\r\n\r\n<p><strong>c.</strong> Dreptul de a solicita ștergerea datelor cu caracter personal, iar &icirc;n cazul &icirc;n care datele cu caracter personal au fost facute publice, transmiterea informațiilor referitoare la solicitarea de ștergere către alți operatori.</p>\r\n\r\n<p><strong>d.</strong> Dreptul de a solicita restricționarea prelucrării datelor.</p>\r\n\r\n<p><strong>e.</strong> Dreptul de a primi datele personale cu privire la persoana vizată &icirc;ntr-un format structurat, utilizat &icirc;n mod obișnuit și de a solicita transmiterea acestor date către un alt operator.</p>\r\n\r\n<p><strong>f.</strong> Dreptul de a se opune prelucrării datelor cu intenția de a &icirc;nceta prelucrarea.</p>\r\n\r\n<p><strong>g.</strong> Dreptul de a retrage oric&acirc;nd un consimțăm&acirc;nt dat &icirc;n vederea opririi unei prelucrări a datelor care se bazează pe consimțăm&acirc;ntul clientului. Retragerea nu va afecta legalitatea prelucrării pe baza consimțăm&acirc;ntului acordat &icirc;nainte de retragere. Retragerea consimțăm&acirc;ntului privind prelucrarea datelor cu caracter personal nu poate avea loc &icirc;n privința respectării obligațiilor legale.</p>\r\n\r\n<p><strong>h.</strong> Dreptul utilizatorului de a depune o plangere la o autoritate de supraveghere dacă apreciază &icirc;n mod justificat că prelucrarea datelor cu caracter personal a fost efectuata de Operator cu &icirc;ncălcarea GDPR.</p>\r\n\r\n<p>Exercitarea acestor drepturi privind prelucrarea datelor cu caracter personal nu poate avea loc &icirc;n privința respectării obligațiilor legale ale Operatorului.</p>\r\n\r\n<p><strong>V. Modificări &icirc;n politica de confidențialitate</strong></p>\r\n\r\n<p>Ne rezervăm dreptul de a modifica această politică de confidențialitate. Politica de confidențialitate cu modificările și completările ulterioare va fi publicată in aplicație.</p>', '{\"name\":\"value\",\"label\":\"Value\",\"type\":\"ckeditor\"}', 1, NULL, '2020-02-21 15:34:46'),
